  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mark Twain
  National Wildlife Refuges outlines Refuge accomplishments during the 1976 calendar
  year. The report begins with an introduction to the Refuge and information about
  climate conditions, habitat conditions, land acquisition, and system status. Construction,
  maintenance, and wildfires are also described. Habitat management is covered; croplands,
  grasslands, wetlands, forestlands, and wilderness and special areas are discussed.
  The wildlife section of the report discusses endangered and threatened species,
  migratory birds, big game animals, and raptors. Interpretation and recreation activities
  are outlined; topics include information and interpretation, recreation, and law
  enforcement. Field investigations, cooperative programs, items of interest, and
  safety are discussed.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
